import React from "react";
import Box from '@mui/material/Box';

const LoginForm = () => {
    return (
        <Box 
            height={500}
            width={500}
            my={4}
            mx={55}
            display="flex"
            alignItems="center"
            gap={4}
            p={2}
            sx={{ border: '2px solid grey', fontFamily: T }}
        >
        </Box>
    )
}

export default LoginForm
